songs.lyrics:
Au niveau de la pollution
C'est pas la joie {x2}
Au niveau de la télévision
C'est pas la joie {x2}
Au niveau de la montée des prix
C'est pas la joie {x2}
Au niveau des embarras de Paris
C'est pas la joie {x2}

Y a encore qu'au niveau de l'amour que ça marche toujours

Au niveau de l'environnement
C'est pas la joie {x2}
Au niveau de la gueule des passants
C'est pas la joie {x2}
Au niveau de la contestation
C'est pas la joie {x2}
Au niveau des manifestations
C'est pas la joie {x2}

Y a encore qu'au niveau de l'amour que ça marche toujours

Au niveau de nos feuilles d'impôts
C'est pas la joie {x2}
Au niveau du cinéma porno
C'est pas la joie {x2}
Au niveau de la dévaluation
C'est pas la joie {x2}
Au niveau de la surpopulation
C'est pas la joie {x2}

Y a encore qu'au niveau de l'amour que ça marche toujours

Dans le sable du désert
Sur les dunes de la mer
Et tant pis si tu te perds
Cherche la rose {la rose}

Aux lucarnes des prisons
Où l'on rêve de pardon
Où se meurt une chanson
Cherche la rose {la rose}

Sous les mousses, les orties
Dans les flaques de la pluie
Sur les tombes qu'on oublie
Cherche la rose {la rose}

Où s'attristent les faubourgs
Chez l'aveugle, chez le sourd
Où la nuit rêve du jour
Cherche la rose {la rose}

Au fond de ton cœur meurtri
Où la source se tarit
Où dans l'ombre monte un cri
Cherche la rose

Et battant tous les pavés
Si tu n' l'a point trouvée
Tu l'auras au moins rêvée
Cherche la rose {la rose}
Cherche la rose {la rose}
La rose {la rose}
La rose {la rose}
La rose {la rose}
La rose {la rose}...
